ci.&lt;/P&gt;  &lt;P&gt;&lt;BR&gt;Disky CD-RW společnosti Verbatim jsou ideální pro každého, kdo chce ukládat a přepisovat obrázky nebo jiná data. Disky CD-RW od společnosti Verbatim jsou ideální pro ukládání osobních dat, multimediální prezentace, ukládání obrázků (včetně digitálních fotografií), dočasné ukládání stažených souborů, záloh, souborů DTP, vývoj softwaru i archivaci. U médií CD-RW společnosti Verbatim prakticky neexistuje způsob, jak při záznamu zničit disk. Pokud není něco správně zaznamenáno, bude přepsána buď jen část disku, nebo celý disk. Jak jednoduché!&lt;BR&gt;Vysoce výkonná zapisovací vrstva,&lt;BR&gt;vysoce odolná ochranná vrstva,&lt;BR&gt;minimálně 1 000 přepsání&lt;/P&gt;  &lt;P&gt;&lt;BR&gt;Doživotní záruka.&lt;BR&gt;&lt;BR&gt;Číslo součásti: 43480&lt;BR&gt;Kapacita: 700MB&lt;BR&gt;Max. Zapis. Rychlosted: 8x - 12x&lt;BR&gt;Balení: 10 Pack Spindle&lt;BR&gt;Povrch: Scratch Resistant&lt;/P&gt;","false","0","0001011700090001","2438","8","true","00020074","4173","194","true","24","Měsíc(ů)","","0001-01-01T00:00:00","158.00","KS","15.00","3","2015-02-17T14:53:48.827","VER","383","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_112\/112671_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_112\/112671_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_112\/112671_0c_3.jpg'}","{'0':{'AttributeCode':'877','ValueCode':'10898'},'1':{'AttributeCode':'119','ValueCode':'553'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.215','length':'14','width':'14','height':'3.2'},'1':{'typ':'PACK','count':'20','weight':'4.5','length':'58.5','width':'15.5','height':'16.5'}}","N","","false",""),("112927","710491","VERBATIM DVD-RW(5-pack)Jewel/4x//DLP/4.7GB","107.00","132.00","VER","0.00","25.00","0.000000","0.000","24 Měsíc(ů)","VERBATIM","112.00","165.00","21.00","43285","true","50-99","","Verbatim","85234130","023942432852","VERBATIM DVD-RW(5-pack)Jewel/4x//DLP/4.7GB","Typ média:DVD-RW; Druh balení média:Jewel","1","&lt;div class='prodata' style='padding-left: 