eCode':'878','ValueCode':'10908'},'3':{'AttributeCode':'878','ValueCode':'10909'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.914','length':'14','width':'14','height':'9'},'1':{'typ':'PACK','count':'4','weight':'4.055','length':'59.5','width':'15.5','height':'12.5'}}","N","","false",""),("291991","711021","VERBATIM BD-RE SL(10-pack)Blu-Ray/spindle/2x/25GB","269.00","319.00","VER","0.00","50.00","0.000000","0.000","24 Měsíc(ů)","VERBATIM","270.00","336.00","21.00","43694","true","8,00","","Verbatim","85234130","023942436942","VERBATIM BD-RE SL(10-pack)Blu-Ray/spindle/2x/25GB","Typ média:Bluray BR-RE; Druh balení média:Spindle","1","&lt;b&gt;BD-RE SL 25GB 2x 10 Pack Spindle&lt;/b&gt;&lt;br&gt;    &lt;br&gt;  Nástup technologie Blu-ray vedl k představení disků s velkou kapacitou ukládání, které splňují požadavky kladené rychlým rozvojem televizního vysílání s vysokým rozlišením (HDTV).&lt;br&gt;  &lt;br&gt;  Název disků Blu-ray je odvozen od technologie modrého laserového paprsku. Kratší vlnová délka paprsku způsobuje jeho modré zabarvení. Modrý laser má vlnovou délku 405 nm, zatímco červené lasery, používané s disky DVD, mají vlnovou délku 650 nm. Výhodou modrého laseru s kratší vlnovou délkou je, že lze zapisovat menší datové otvory, a tím zvyšovat množství dat na disku.&lt;br&gt;  &lt;br&gt;  Disky Blu-ray nabízí 3krát až 5krát větší úložnou kapacitu než standardní zapisovatelné disky DVD, čímž povolují záznam, přepis a přehrávání videozáznamů ve vysokém rozlišení (HD).&lt;br&gt;  &lt;br&gt;  Vysoká kapacita – 25 GB/50 GB&lt;br&gt;  Vlnová délka laseru: 405 nm&lt;br&gt;  Ochranná vrstva Hard Coat.&lt;br&gt;  Dlouhá životnost při archivaci.&lt;br&gt;  Mimořádný výkon při přehrávání.&lt;br&gt;  Pro použití v zapisovacích jednotkách a rekordérech BD.&lt;br&gt;  &lt;br&gt;  Přepisovatelný disk Blu-ray s technologií Hard Coat Protection, která zvyšuje životnost a dovoluje až 1 000 přepsání disku. Disky BD-RE mají záznamovou vrstvu SERL (Super Eutectic Recording Layer).