é alebo polarizačné materiály. &lt;p&gt;&lt;strong&gt;Funkcie&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Bez izopropylalkoholu&lt;/li&gt; &lt;li&gt;Bezpečné na použitie na povrchoch LCD - pomáha obnoviť a udržať jas a čistotu&lt;/li&gt; &lt;li&gt;Ideálne na použitie s plochými displejmi, notebookmi, vreckovými zariadeniami, klávesnicami a ďalšími zariadeniami&lt;/li&gt; &lt;li&gt;Mäkká kefka jemne odstraňuje prebytočný prach a nečistoty bez poškriabania&lt;/li&gt; &lt;li&gt;Čistiaci prostriedok bez použitia aerosólu odstraňuje odtlačky prstov a šmuhy bez použitia drsných rozpúšťadiel&lt;/li&gt; &lt;li&gt;Mäkká utierka z mikrovlákna, ktorá nepúšťa vlákna, čistí, suší a leští pre čistý, neškriabavý povrch&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;strong&gt;ŠPECIFIKÁCIE&lt;/strong&gt; &lt;ul&gt; &lt;li&gt;Čistiaci roztok: 200 ml (6.75 oz.); pracovná a skladovacia teplota, -10 - 50 °C&lt;/li&gt; &lt;li&gt;Utierka z mikrovlákna: 30 x 30 cm (12 x 12 palcov))&lt;/li&gt; &lt;li&gt;Výsuvná kefa: 14 cm (5.5 in.)&lt;/li&gt; &lt;li&gt;Obsah balenia&lt;/li&gt; &lt;li&gt;Súprava na čistenie LCD&lt;/li&gt; &lt;/ul&gt;.","false","0","0001022300030002","8384","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","172.00","KS","0.00","3","2019-06-19T09:16:04.367","MAN","383","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328329_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328329_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_328\/328329_0c_3.jpg'}","{'0':{'AttributeCode':'880','ValueCode':'10925'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.331','length':'23','width':'20','height':'8.5'},'1':{'typ':'PACK','count':'24','weight':'12','length':'42','width':'45','height':'47'}}","N","","false",""),("328405","254005","MANHATTAN Stlačený vzduch 400ml","82.00","82.00","MAN","0.00","0.00","0.000000","0.000","24 Měsíc(ů)","MANHATTAN","83.00","100.00","21.00","156141","false","0,00","","Manhattan","38275900","766623156141","MANHATTAN Stlačený vzduch 400ml","P