t;  Disky BD-R jsou určeny pro použití v jednotkách a rekordérech BD. Delší životnost díky technologii Hard Coat Protection.&lt;br&gt;  &lt;br&gt;  Určený výhradně pro použití v jednotkách a rekordérech, které podporují 25GB disky Blu-ray bez kazety.&lt;br&gt;  &lt;br&gt;  Císlo soucásti: 43723&lt;br&gt;  Kapacita: 50GB&lt;br&gt;  Max. Zapis. Rychlosted: 2x&lt;br&gt;  Baleni: 25 Pack Spindle&lt;br&gt;  Povrch: Therman Printable - No ID Brand&lt;br&gt;  Oblast tisku: 22-117mm&lt;br&gt;  &lt;br&gt;  Tento disk splňuje specifikaci BD-R verze 1.2.&lt;br&gt;  &lt;br&gt;  Tepelně potiskovatelná média jsou určena pro tisk na speciálních tepelných tiskárnách nebo tiskárnách s tepelnou sublimací. Na tato média nelze tisknout prostřednictvím inkoustových tiskáren. Na trhu je pouze omezené množství tepelných tiskáren, přičemž většinu z nich využívají profesionální zařízení pro vytváření kopií. &lt;br&gt;","false","0","000101170017","4624","-1","true","00020074","4173","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","1978.00","KS","2.00","1","2011-06-07T17:10:21.32","VER","383","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_349\/349072_0a_3.jpg'}","{'0':{'AttributeCode':'877','ValueCode':'10905'}}","{'0':{'typ':'JEDN','count':'1','weight':'0.474','length':'14','width':'14','height':'5.5'},'1':{'typ':'PACK','count':'4','weight':'2.2','length':'31.5','width':'16','height':'13.5'}}","N","","false",""),("349080","711291","VERBATIM DVD-R(50-Pack)Spindle/Printable/16x/4.7GB/WIDE PRINTABLE SURFACE NON-ID","343.00","393.00","VER","0.00","50.00","0.000000","0.000","24 Měsíc(ů)","VERBATIM","344.00","429.00","21.00","43744","false","0,00","","Verbatim","85234130","023942437444","VERBATIM DVD-R(50-Pack)Spindle/Printable/16x/4.7GB/WIDE PRINTABLE SURFACE NON-ID","Typ média:DVD-R; Druh balení média:Spindle; Vlastnosti média:Potisknutelné","1","&lt;p&gt;&lt;strong&gt;DVD-R Wide Inkjet Printable No ID Brand&lt;/strong&gt;&lt;br /&gt;&lt;br /&gt;Disky DVD-R společnosti Verbatim byly 