aserový lúč sa tak môže zaznamenať na oboch vrstvách. Po zaznamenaní prvej vrstvy sa laser znovu zaostrí na záznam druhej vrstvy. 8.kapacita 5 GB na jednom disku! &lt;p&gt;&lt;strong&gt;Prispôsobte si svoj disk&lt;/strong&gt;&lt;br/&gt;Potlačiteľné disky Verbatim majú potlačiteľný povrch určený na použitie s atramentovou tlačiarňou. Tieto disky umožňujú vytlačiť na celý povrch disku čokoľvek, čo si želáte. &lt;p&gt;&lt;strong&gt;Life Series&lt;/strong&gt;&lt;br/&gt;Life Series DVD+R DL je optimalizovaný pre dátové a video aplikácie. &lt;br/&gt; &lt;p&gt;TECHNICKÉ ŠPECIFIKÁCIE &lt;table dir='LTR' border='1' width='880' cellspacing='0' cellpadding='2'&gt; &lt;tbody&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Produkt&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;DVD+R DL&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Záruka&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Životnosť &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Kapacita&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;8,5 GB &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Atramentová tlač&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;Áno&lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Štýl balenia&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;vreteno s 50 baleniami &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Oblasť tlače&lt;/strong&gt;&lt;/td&gt; &lt;td width='74%' height='19'&gt;23-118 mm &lt;/td&gt; &lt;/tr&gt; &lt;tr&gt; &lt;td style='width: 30%; height: 19px;' width='74%' height='19'&gt;&lt;strong&gt;Povrch disku&lt;/strong&gt;&lt;/td&gt; &l